import React, { useEffect } from 'react'
import { ArrowLeft } from 'react-bootstrap-icons'
import { Link } from 'react-router-dom'
import GallerySpace from '../Utilities/GallerySpace'
import Gods_Alternative_to_Bloodshed_2013 from "../Utilities/GodsAlternativetoBloodshed2013Gallery"
import Footer from './Footer'


function Gallery() {
  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className=''>
      <div><GallerySpace title={"God's Vineyard Gospel Tournament 2024"} id={"tournament"}/></div>
      <div>
        <Gods_Alternative_to_Bloodshed_2013 id={'godsalternativetobloodsheed2013'} title={"God's Alternative to Bloodshed 2013"}/>
      </div>
      <Footer/>
    </div>
  )
}

export default Gallery
